  background: #F9F8F8;
  padding-top: 5rem;
  padding-bottom: 5rem;
`

const AboutInner = styled(Container)`
  display: flex;
  align-items: center;
  justify-content: space-between;
  gap: 2rem;
`

function About() {
  return (
    <StyledAbout>

    </StyledAbout>
  );
}

export default About;
